Вода артезианская ЧЕРНОГОЛОВКА негазированная 2,5л в пластиковой бутылке - Вода для Жизни, вода на каждый день! Мы заботливо добываем воду ЧЕРНОГОЛОВКА из артезианской скважины, проводим бережную фильтрацию, сохраняя максимум пользы от самой природы! Уникальная прямоугольная упаковка специально разработана для удобства использования дома, в дороге, на природе. Превосходно помещается на полку холодильника, машины, в карман рюкзака. Удобная ручка позволяет легко наливать воду взрослым и маленьким членам семьи. Оптимальный объем для небольшой семьи.
Условия хранения

Хранить при температуре от +5°С до +25°С и относительной влажности не более 85%.
Беречь от воздействия прямого солнечного света. Срок годности вскрытой тары не более трех суток при температуре не выше +10°С.
Состав

Гидрокарбонаты НСО3130-280; 
Хлориды Cl - 0,1-10; 
Сульфаты SO4- 0,1-20; 
Кальций Ca2+ 30-60; 
Магний Mg2+ 5-30; 
Калий К+ 0,1-10; 
Натрий Na+ 0,1-20. 
Общая минерализация: 0,2 - 0,35 г/л. 
Общая жесткость : 3,0 - 4,5 мг-экв/л.
